import React, { useState } from 'react';

function AppSuivi() {
  const [boutonClique, setBoutonClique] = useState(null);

  return (
    <div>
      <button onClick={() => setBoutonClique(1)}>Bouton1</button>
      <button onClick={() => setBoutonClique(2)}>Bouton2</button>
      <button onClick={() => setBoutonClique(3)}>Bouton3</button>
      {boutonClique && <p>Bouton #{boutonClique} a été cliqué</p>}
    </div>
  );
}

export default AppSuivi;
